import React, { Component } from 'react'

export default class MarketplaceItem extends Component {
    render() {
        return (
            <div className="card m-2" style={{ width: '18rem' }}>
                <img src="https://images-na.ssl-images-amazon.com/images/I/71AmGdRWFvL._UX679_.jpg" className="card-img-top" alt="..." />
                <div className="card-img-overlay ">
                    <button className="btn btn-dark align-self-end font-weight-bold">$25</button>

                    <span class="badge badge-dark">Dark</span>
                </div>
                <div className="card-footer">
                    <h6 className="card-title m-0">Nombre del producto</h6>
                    <p className="card-text"><small class="text-muted">Hace 5 horas</small></p>
                </div>
            </div>
        )
    }
}
